import Layout from '../components/Layout';


const Index = () => (
  <Layout>
	  <div>
	  	<h1>Welcome to J-Sleeve!</h1>
	  	<div className="block">
	  		<button className="button">Button</button>
	  	</div>
	  </div>
  </Layout>
);

export default Index;
